import React from 'react'
import './CarPage.css';

export default function CarPageSingle() {
    return (
        <div className='carPage'>
            <div className='auction-title'>
                <h1>2017 BMW M4 Coupe</h1>
                <button class="toggle-watch  "><span class="sr-only">Watch</span></button>
            </div>
        </div>
    )
}
